import "./Footer.css";

const Footer = () => {
    return (
        <div className="footer">
            <a href="https://www.github.com/paluthebear/"><img src="https://github.githubassets.com/images/modules/logos_page/GitHub-Mark.png"/></a>
            <a href="https://www.instagram.com/paluthebear/" style={{scale: "0.8"}}><img src="https://upload.wikimedia.org/wikipedia/commons/e/e7/Instagram_logo_2016.svg"/></a>
        </div>
    )
}

export default Footer;
